function parseChanges(propfindXML) {

    var rawNodes = new Query("/D:multistatus/D:response").
        findAll(propfindXML.documentElement);

    // META: updating loading status: a crosscutting concern? use cop in parts?
    this.get('Status').textString = 'loaded ' + rawNodes.length +
        ' revisions in ' + (Date.now() - this.startLoading) / 1000 + "s"

    var parseTime = Date.now();
    var svnVersionInfos = rawNodes.map(function(rawNode) {
        return SVNVersionInfo.fromPropfindNode(rawNode) });

    this.revisions = svnVersionInfos.sortBy(function(ea) { 
        return ea.rev 
    }).reverse()

    this.displayFilteredText();


    this.get('Status').textString += ' displayed in ' + (Date.now() - parseTime) / 1000 + "s" ;


}

