function displayFilteredText() {
    if (!this.revisions) return;

    var table = this.get('VersionTable');
    var repoURL = '/repository/webwerkstatt';

    var filter;
    try {
        filter = new RegExp(this.get('Filter').textString)
        this.get('Filter').setFill(null)
    } catch (e) {
        filter = new RegExp(".*");
        this.get('Filter').setFill(Color.red)
    }

    // META: should these two functions be refactored into an own class?
    var forceStringWidth = function(s, n, left) {
        return Strings.pad(s.substring(0,n), n - s.length, left)
    }

    var current = {};
    // three strikes than refactor... ok, here we go
    var onlyWhenNew = function(s, name, n) {
        if (s == current[name]) {
            return forceStringWidth("", n)
        } else {
            current[name] = s ;
            return forceStringWidth(s, n);
        }
    }

    var filteredRevisions = this.revisions.select(function(ea) {
        return ( ea.author + " "+ ea.url).match(filter)
    })

    this.get('VersionTable').textString = filteredRevisions
        .select(function(ea) { return ea.fileSize != -1 }) // filter directories
        .collect(function(ea) {
        var s = ""
        s += onlyWhenNew(ea.date.format("yyyy-mm-dd"), "date", 11);
        s += onlyWhenNew(ea.date.format("HH:MM"), "time", 6);
        s += onlyWhenNew(ea.author, "author", 16);
        s += onlyWhenNew(""+ea.rev, "rev", 8);
        // s += onlyWhenNew(""+ (ea.fileSize > 0 ? Math.round(ea.fileSize / 1024) +"kb" : ""), "fileSize", 16);
        s += onlyWhenNew(ea.url.replace("/repository/webwerkstatt/",''), "url", 255)
        return s
    }).join('\n')

    table.applyStyle({textColor: Color.darkGray})
    // table.emphasizeRegex(/[^\/]*?\.((html)|(js)|(xhtml))/g, {color: Color.blue})
}

